import React from 'react';
import './components.css';

const Projects = () => {
  return (
    <section id="projects">
    <h1>My Projects</h1>
      <p>Ecoutopia<br></br>

Ecoutopia is a collaborative project where my team and I developed a fully functional e-commerce website specializing in plant sales. Leveraging HTML, Flask, JavaScript, CSS, and Bootstrap, we created a seamless user experience with robust backend functionality. This project allowed me to enhance my skills in web development, teamwork, and problem-solving, contributing to a successful implementation that met both functional and aesthetic goals.</p>
    I also have multiple smaller projects that I am currently working on. Here is one using react!
    </section>
  );
};

export default Projects;
